import React, { Component } from 'react';

class Solution extends Component {

    spaces(num){
        let spaceArray = []
        for (let i = 0; i< num; i ++){
            spaceArray.push(" _ ")
        }
        return(
            spaceArray
        )
    }

    hint(hintContent){
        return(
            hintContent
        )
    }

    render() {
        return (
            <div>
                <div>{this.spaces(4)}</div>
                <div>{this.hint("She is blond and cute and likes to poop alot. Also, she used to be a puppy once")}</div>               
            </div>
        );
    }
}

export default Solution;
